(152, 'widget_glf-about-us', 'a:3:{s:12:\"_multiwidget\";i:1;i:2;a:6:{s:5:\"title\";s:16:\"We are Pronto NY\";s:8:\"subtitle\";s:8:\"About Us\";s:4:\"text\";s:607:\"<p>At Restaurant Pronto we pride ourselves with the ability to offer our customers delicious and authentic Italian food, created at the highest standards. Every single meal we make is unique. We guarantee that you won`t get disappointed.</p><p>The key to our success is simple: providing exquisite meals, made out of only the purest and freshest of ingredients that taste great every single time.</p><p>Our goal is to help you enjoy the little things in life that matter. So eat delicious food. Grab a drink. But most of all, relax! We thank you from the bottom of our hearts for your continued support.</p>\";s:7:\"columns\";i:2;s:7:\"image_1\";s:104:\"http://localhost/Restaurant/wordpress/wp-content/themes/gloriafood-restaurant/assets/starter/about-1.jpg\";s:7:\"image_2\";s:104:\"http://localhost/Restaurant/wordpress/wp-content/themes/gloriafood-restaurant/assets/starter/about-2.jpg\";}i:3;a:5:{s:5:\"title\";s:19:\"Food Delivery in NY\";s:8:\"subtitle\";s:22:\"Get Served Like a King\";s:4:\"text\";s:324:\"<p>Looking for food delivery nearby? Not everybody knows or has the time to prepare tasty food.</p><p>When you want to get served like a king then food delivery from restaurant Pronto will be your best choice.</p><p>Simply select \"Delivery\" at the checkout screen and we hope you\'ll appreciate our food delivery service.</p>\";s:7:\"columns\";i:1;s:7:\"image_1\";s:110:\"http://localhost/Restaurant/wordpress/wp-content/themes/gloriafood-restaurant/assets/starter/food-delivery.jpg\";}}', 'yes'),
(153, 'widget_glf-promo-cards', 'a:2:{s:12:\"_multiwidget\";i:1;i:2;a:15:{s:7:\"title_1\";s:17:\"Best Friends Deal\";s:10:\"subtitle_1\";s:17:\"Sharing Is Caring\";s:6:\"text_1\";s:97:\"<p>2 Medium Pizzas</p><p>Soft Drinks</p><p>Garlic Bread or Patato Wedges</p><o>Salad to share</o>\";s:13:\"price_label_1\";s:4:\"Only\";s:7:\"price_1\";s:3:\"$20\";s:7:\"title_2\";s:16:\"Buy 1 Get 1 FREE\";s:10:\"subtitle_2\";s:14:\"This Week Only\";s:6:\"text_2\";s:119:\"<p>Hope you are hungry. Buy one regular priced pizza online and get a second pizza totally free!</p><p>Online only!</p>\";s:13:\"price_label_2\";s:11:\"Order code:\";s:7:\"price_2\";s:4:\"7867\";s:7:\"title_3\";s:16:\"Awesome Foursome\";s:10:\"subtitle_3\";s:12:\"Sundays Only\";s:6:\"text_3\";s:129:\"<p>6 Delicious regular size pizzas to choose from: Margherita, Capricciosa, Prosciutto e Funghi, Diavola, Calzone, Primavera.</p>\";s:13:\"price_label_3\";s:4:\"Only\";s:7:\"price_3\";s:3:\"$40\";}}', 'yes'),
