(18, 1, '2021-03-16 11:24:32', '2021-03-16 11:24:32', '<h1>Welcome to Delicious</h1>		\n										<img width=\"768\" height=\"480\" src=\"http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/carous2-1-768x480.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/carous2-1-768x480.jpg 768w, http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/carous2-1-300x188.jpg 300w, http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/carous2-1-1024x640.jpg 1024w, http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/carous2-1-1536x960.jpg 1536w, http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/carous2-1.jpg 1920w\" sizes=\"(max-width: 768px) 100vw, 768px\" />											\n		<p style=\"padding-left: 40px;\">Delicious allows you to have a website and a management back office at your disposal.</p>\n<p style=\"padding-left: 40px;\">The website presents your restaurant, your menu, your photos and your news. Your customers will be able to book a table online, order online and request a service for an event.</p>\n<p style=\"padding-left: 40px;\">The back office is a private space on the web which is dedicated to the management of your restaurant, you can manage your site independently. Very easy to use, you can update your card according to the season, your stocks and your promotions ...</p>		\n			<a href=\"#\" role=\"button\">\n						Learn more\n					</a>\n			<h1>Our Offered Menus</h1>		\n										<img width=\"862\" height=\"574\" src=\"http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/gal3-1024x682.jpg\" alt=\"\" loading=\"lazy\" srcset=\"http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/gal3-1024x682.jpg 1024w, http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/gal3-300x200.jpg 300w, http://localhost/Restaurant/wordpress/wp-content/uploads/2021/03/gal3-768x512.jpg 768w, http://localhost/Restaurant/wordpress/wp-content/uploads/